import math
def normal_round(n):
    if n - math.floor(n) < 0.5:
        return math.floor(n)
    return math.ceil(n)

def isMultiple(a, b, n):
    to_test = normal_round((a/b - int(a/b)) * 10)
    if to_test >= 10:
        return False
    else:
        return to_test > 0 and to_test % n == 0

def isMultiple(a, b, n):
    def rond(x):
        return int(x) if x % 1 < 0.5 else int(x + 1)

    res = a/b
    res = rond(res*10) / 10
    #Extra round here to deal with floating-point nonsense
    remainder = round(res % 1,1)
    return remainder and not (10*remainder) % n
